export function searchLocalJobs(query: string): LocalJob[] {
  const q = query.toLowerCase();
  return JOBS
    .filter(j => j.title.toLowerCase().includes(q))
    .sort((a, b) => b.ai_risk_score - a.ai_risk_score)
    .slice(0, 20);
}
